import PosData from "./positionData";
import Vector2 from "../Vector2";

let positions = new Map();

export function GetPositionData(id) {
  if (positions.has(id)) {
    return positions.get(id);
  }
}
export function UpdatePositionData(id, x, y) {
  if (positions.has(id)) {
    positions.set(id, x, y);
  }
}
